import actionTypes from '../../commons/const/actionTypes';

var initialState = {}
var myReducer = (state = initialState, action) => {
  switch (action.type) {

    case actionTypes.setCurrentUser:
      return action.data
    case actionTypes.CHANGE_AVATAR_USER:
      return action.data
    default:
      return state;
  }
}

export default myReducer;
